import React from 'react';

export  const EmailIcon = ({ className  }) =>  {
  return (
    <svg className={className} xmlns="http://www.w3.org/2000/svg" width="12" height="10" viewBox="0 0 12 10">
  <g id="Icona_mail" data-name="Icona mail" transform="translate(0.5 0.5)">
    <g id="Message">
      <path id="Stroke_1" data-name="Stroke 1" d="M6.481,0,4.037,1.807a1.363,1.363,0,0,1-1.573,0L0,0" transform="translate(2.265 2.926)" fill="none" stroke="#ff001b" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="1"/>
      <path id="Stroke_3" data-name="Stroke 3" d="M8.2,9A2.711,2.711,0,0,0,11,6.219V2.785A2.717,2.717,0,0,0,8.2,0H2.8A2.717,2.717,0,0,0,0,2.785V6.219A2.711,2.711,0,0,0,2.8,9Z" fill="none" stroke="#ff001b" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="1"/>
    </g>
  </g>
</svg>

  )
}

export  const PasswordIcon = ({ className  }) =>  {
  return (
    <svg className={className} xmlns="http://www.w3.org/2000/svg" width="8.841" height="10.527" viewBox="0 0 8.841 10.527">
  <g id="Icona_haslo" data-name="Icona haslo" transform="translate(-0.25 -0.25)">
    <path id="Stroke_1" data-name="Stroke 1" d="M4.7,3.449V2.344A2.349,2.349,0,0,0,0,2.333V3.449" transform="translate(2.322 0.75)" fill="none" stroke="#ff001b" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="1"/>
    <path id="Stroke_3" data-name="Stroke 3" d="M5.888,6.115H1.953A1.953,1.953,0,0,1,0,4.162V1.953A1.953,1.953,0,0,1,1.953,0H5.888A1.953,1.953,0,0,1,7.841,1.953V4.162A1.953,1.953,0,0,1,5.888,6.115Z" transform="translate(0.75 4.163)" fill="none" stroke="#ff001b" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="1"/>
    <path id="Stroke_5" data-name="Stroke 5" d="M.5,0V1.144" transform="translate(4.171 6.648)" fill="none" stroke="#ff001b" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="1"/>
  </g>
</svg>


  )
}
